import React from 'react';
import logo from './logo.svg';
import './App.css';

const bucketListData = [
  {
    title:"Bucket 1",
    bucketId:"123"
  },
  {
    title:"Bucket 2",
    bucketId:"123"
  },
  {
    title:"Bucket 3",
    bucketId:"123",
  }
]

const todoList = (data) => {
  let h = [];
  data.map((item,index)=>{
    h.push(
      <tr key={index}>
        <td><input type="checkbox"/></td>
      <td>{item.taskName}</td>
      <td><button>Delete</button></td>
      <td><button>Edit</button></td>
    </tr>
    )
  })
  return h;
}
const bucketList = () => {
  let h= [];
   bucketListData.map((item,index)=>{
        h.push(<div className="col-sm-4 col-md-4 col-xs-12"><table key={index} className="table">
          <thead className="thead-dark">
            <tr>
              <th></th><li> {item.title}</li>
            </tr>
            <tr><th></th><th scope="col"><input type="text" placeholder="Add New"/></th></tr>
          </thead>
            <tbody>
            {todoList(item.data)}
            </tbody>
        </table>
        </div>
        )
      })
      return h; 
}
function App() {
  return (
    <div className="container">
      <h1>BucketLists</h1>
      <input placeholder="Add New Bucket" type="text"/>
      <ul>

      </ul>
    </div>
  );
}

export default App;
